package Basics;

public class ArithmeticOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=23;
		int b= 07;
		int c,d,e,f;
		c=a+b;
		d=a-b;
		e=a*b;
		f= a/b;
		System.out.println("c=" +c);
		System.out.println("d=" +d);
		System.out.println("e=" +e);
		System.out.println("f=" +f);
	}

}
